import PriceList from '../components/PriceList'
import MonthPicker from '../components/MonthPicker'

import { LIST_VIEW, CHART_VIEW,TYPE_INCOME,TYPE_OUTCOME } from '../utility'

const items = [
  {
    "id": 1,
    "title": "traveling to YunNan",
    "price": 200,
    "date": "2018-09-10",
    "category": {
      "id": "1",
      "name": "travel",
      "type": "outcome",
    }
  },
  {
    "id": 2,
    "title": "traveling to YunNan",
    "price": 400,
    "date": "2018-09-10",
    "category": {
      "id": "1",
      "name": "travel",
      "type": "outcome",
    }
  }, {
    "id": 3,
    "title": "salary",
    "price": 400,
    "date": "2018-09-10",
    "category": {
      "id": "1",
      "name": "travel",
      "type": "income"
    }
  }
]
const account = {
  income: 600,
  outcome: 500
}
class Home extends Component {
  render() {
    let totalIncome = 0,totalOutcome =0
    items.forEach(
      item=> {
        if(item.category.type === TYPE_OUTCOME){
          totalIncome += item.price
        }else{
          totalIncome += item.price
        }
      }
    )
    return (
      <Fragment>
        <header className="App-header">
         <div className="row mb-5">
         <img src={logo} className="App-logo" alt="logo" />
         </div>
         <div className="row">
          <div className="col">
          <MonthPicker 
          year={2018}
          month={8}
          onChange={()=>{}}
          />
          </div>
          <div className="col">
         {/* <TotalPrice
         income={totalIncome}
         outcome={totalOutcome}
         /> */}
          </div>
         </div>
        </header>
      </Fragment>
    )
  }
}

export default Home
